      shortCode
    }
  },
  allMasterMetalsPurities {
    nodes {
      alias
      id
      name
      shortCode
    }
  },
  allMasterDiamondsColors {
    nodes {
      alias
      id
      name
      shortCode
    }
  },
  allMasterDiamondClarities {
    nodes {
      alias
      id
      name
    }
  },
  allMasterVendors {
    nodes {
      id
      name
      shortCode
      vendorDelivaryDays

    }
  }
  allProductLists(orderBy: PRODUCT_SERIES_DESC, first: 1) {
    nodes {
      productSeries
      id
    }
  },
  allMasterGemstonesTypes {
    nodes {
      alias
      colorCode
      id
      name
      shortCode
    }
  },
  allMasterGemstonesShapes {
    nodes {
      alias
      id
      name
    }
  },
  allMasterEarringBackings {
    nodes {
      name
      createdAt
      alias
      id
      nodeId
      updatedAt
    }
  }
  allMasterGemstonesSettings {
    nodes {
      alias
      id
      name
    }
  }
  }`
const PRODUCTLIST = gql`
query MyQuery($Veiw: Int!, $Offset: Int!) {
  allProductLists(first: $Veiw, offset: $Offset) {
    nodes {
      id
      nodeId
      productName
      productType
    }
    totalCount
  }
}
`;
const PRODUCTEDIT = `
query MyQuery($productId: ID!) {
  productList(nodeId: $productId) {
    productName
    productType
    productCategory
    productDiamondsByProductSku {
      nodes {
        diamondColour
        diamondSettings
        diamondShape
        diamondType
        diamondClarity
        stoneWeight
        stoneCount
        id
      }
    }
    productGemstonesByProductSku {
      nodes {
        gemstoneSetting
        gemstoneShape
        gemstoneSize
        gemstoneType
        stoneCount
        stoneWeight
        id
      }
    }
    transSkuListsByProductId {
      nodes {
        metalColor
        purity
        skuWeight
        skuSize
        generatedSku
        id
      }
    }
    productImagesByProductId {
      nodes {
        imageUrl
        imagePosition
        productColor
        id
      }
    }
  }
}
`;
  export {
    PRODUCTCATEGORY,
    PRODUCTLIST,
    PRODUCTEDIT
  }
